import React from "react";
import useInput from "../hooks/useInput";
import { useHistory } from "react-router-dom";
import axios from "axios";
const Login = () => {
  const email = useInput();
  const password = useInput();
  const history = useHistory();
  const handleSumbit = (e) => {
    e.preventDefault();

    axios
      .post("/api/login", {
        email: email.value,
        password: password.value,
      })
      .then((data) => {
        if (data.status === 200) {
          history.push("/inicio");
        }
      });
  };

  return (
    <div className="pading color" >
      <h1 className="color bla">Hola de nuevo!</h1>
      <form onSubmit={handleSumbit}>
        <label className="label my-3 color">Email</label>
        <br />
        <input {...email} type="email" />
        <br />
        <label className="label my-3 color">Password</label>
        <br />
        <input {...password} type="password" />
        <br />
        <button className="button is-link my-5">Submit</button>
      </form>
    </div>
  );
};

export default Login;
